def categorize_numbers(numbers):
    even = []
    odd = []

    for number in numbers:
        if number % 2 == 0:
            even.append(number)
        else:
            odd.append(number)

    return {'even': even, 'odd': odd}

# Example usage and check function
numbers = [1, 2, 3, 4, 5, 6]
result = categorize_numbers(numbers)
print(result)  # Should print: {'even': [2, 4, 6], 'odd': [1, 3, 5]}
```

